import * as React from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

function createData(avatar, name, email, number, action) {
  return { avatar, name, email, number, action };
}

const rows = JSON.parse(localStorage.getItem("contacts") !== null)
  ? JSON.parse(localStorage.getItem("contacts"))
  : [{ name: "no data" }];

rows.forEach((element) => {
  element.action = "edit delete";
  createData(
    element.contactId,
    element.avatar,
    element.name,
    element.email,
    element.number,
    element.action
  );
});

export default function CustomizedTables() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 600 }} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Avatar</StyledTableCell>
            <StyledTableCell align="right">Name</StyledTableCell>
            <StyledTableCell align="right">Number</StyledTableCell>
            <StyledTableCell align="right">Email</StyledTableCell>
            <StyledTableCell align="right">Action</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.forEach((object) => (
            <StyledTableRow key={object.contactId}>
              <StyledTableCell component="th" scope="row">
                {object.avatar}
              </StyledTableCell>
              <StyledTableCell align="right">{object.name}</StyledTableCell>
              <StyledTableCell align="right">{object.email}</StyledTableCell>
              <StyledTableCell align="right">{object.number}</StyledTableCell>
              <StyledTableCell align="right">{object.action}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
